  false,\n\t\"url\": null,\n\t\"notes\": \"The gravity station data (1294 records)
  were compiled by the Alaska Geological Survey and the U.S. Geological Survey, Menlo
  Park, California. This data base was received in September 1986. Principal gravity
  parameters include Free-air Anomalies and Simple Bouguer Anomalies (no terrain correction
  applied) and topographic elevations to compute the anomalies. The observed gravity
  values are referenced to the International Gravity Standardization Net 1971 (IGSN
  71). The gravity anomaly computation uses the Geodetic Reference System 1967 (GRS
  67) theoretical gravity formula. The data are randomly distributed within the boundaries
  of central Alaska.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
